import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        <div class="mb-3">
          <label for="exampleInputUser1" class="form-label">Utilisateur : </label>
          <input type="email" class="form-control" id="exampleInputUser1" placeholder='Saisir l utilisateur'/>
        </div>
        <div class="mb-3">
          <label for="exampleInputEmail1" class="form-label">Email</label>
          <input type="email" class="form-control" id="exampleInputEmail1" placeholder='Saisir l email'/>
        </div>
        <button type="submit" class="btn btn-primary">Valider</button>
      </form>
    </div>
  );
}

export default App;
